import React from 'react';
import { Link } from 'react-router-dom';

const Playlists = ({ url, playlists }) => {

    return (
        <ul>
          {Object.keys(playlists).map( playlistIndex => 
            <li>
              <Link key={playlistIndex} to={`${url}/${playlistIndex}/songs`}>{playlists[playlistIndex].name}</Link>
            </li>
          )}
        </ul>
    )
}

export default Playlists;

